import { DataTable, Table } from '@primer/react/experimental';
import { Label, LabelGroup, RelativeTime } from '@primer/react';

export function AccessTokens() {
  return (
    <Table.Container>
      <Table.Title
        as='h2'
        id='repositories'
      >
        Repositories
      </Table.Title>
      <Table.Subtitle
        as='p'
        id='repositories-subtitle'
      >
        A subtitle could appear here to give extra context to the data.
      </Table.Subtitle>
      <DataTable
        // data={data}
        columns={[
          {
            header: 'Repository',
            field: 'name',
            rowHeader: true,
          },
          {
            header: 'Type',
            field: 'type',
            renderCell: 'Row',
          },
          {
            header: 'Updated',
            field: 'updatedAt',
            renderCell: (row) => {
              return <RelativeTime date={new Date(row.updatedAt)} />;
            },
          },
        ]}
      />
    </Table.Container>
  );
}
